import React from 'react';

function Home() {
    return (
        <div style={{
            backgroundImage: 'url(/images/bg-image.jpg)',
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            backgroundRepeat: 'no-repeat',
            height: '100vh',
        }}>
            <h1>Welcome to the Home Page</h1>
        </div>
    );
}

export default Home;
